AT.\n\nAbout Khan Academy: Khan Academy offers practice exercises, instructional videos, and a personalized learning dashboard that empower learners to study at their own pace in and outside of the classroom. We tackle math, science, computer programming, history, art history, economics, and more. Our math missions guide learners from kindergarten to calculus using state-of-the-art, adaptive technology that identifies strengths and learning gaps. We''ve also partnered with institutions like NASA, The Museum of Modern Art, The California Academy of Sciences, and MIT to offer specialized content.\n\nFor free. For everyone. Forever. #YouCanLearnAnything\n\nSubscribe to KhanAcademy’s New SAT channel:\nhttps://www.youtube.com/channel/UCb6Pzsn8oIFv1N8eGem570A?sub_confirmation=1\nSubscribe to KhanAcademy: https://www.youtube.com/subscription_center?add_user=khanacademy', 'Salman Khan', 'Khan Academy', 'https://www.khanacademy.org', 'https://www.youtube.com/embed/ntTsMZsH2SQ');
